import React from 'react';
import ReactDOM from 'react-dom/client';
import './index.css';
import App from './App';
const express = require("express");
const app = express();
const port = 8080;

app.listen(port, () => {
  console.log('hi');
});

const root = ReactDOM.createRoot(
  document.getElementById('root')
);
root.render(
    <App />
);
